bool increasingTriplet(int* nums, int numsSize) {
    for (int i = 0; i < numsSize; i++) {
        int n1 = nums[i];
        for (int j = i + 1; j < numsSize; j++) {
            int n2 = nums[j];
            for (int k = j + 1; k < numsSize; k++) {
                int n3 = nums[k];
                if (n1 < n2 && n2 < n3) {
                    return true;
                }
            }
        }
    }
    return false;
}

